    <div className="homepage-display-grid">
      <div className="homepage-display-flex">
        <img src=' https://images.ctfassets.net/5de70he6op10/6jZ55m4laSQ27tvuIAb205/a881f1e6487322d9da1a8e59314ea31a/011121_HPG_LS_1.jpg' width='825' height='550'/>
        <div className="homepage-display-split">
          <h1>Image 2</h1>
          <h1>Image 3</h1>
        </div>
        <h1>Image 4</h1>
